const { Classifier } = require('ml-classify-text')

classifyText();


function classifyText()
{
    // classifier instance 
    const classifier = new Classifier();

    // default datasets
    let greenery = [
        'Tree',
        'Leaves',
        'Planting',
        'Plants',
    ]
     
    let negative = [
        'This is really bad',
        'I hate it with a passion',
        'Just terrible!',
    ]

    // training data
    classifier.train(greenery, 'greenery');
    classifier.train(negative, 'negative');

    let model = classifier.model;

    console.log(model.serialize());

    // getting the prediction
    let predictions = classifier.predict('Tree of life');
 
    if (predictions.length) 
    {
        predictions.forEach(prediction => 
        {
            console.log(`${prediction.label} (${prediction.confidence})`);
            document.getElementById("classified-text").innerHTML = prediction.label + " " + prediction.confidence;
        })
    } 
    else 
    {
        console.log('No predictions returned');
    }
}
